    private static String parse(String xml, String xsl) throws BSProgrammerException {
        String out = "";
        if (xml.indexOf("UTF-8") > -1) {
            xml = xml.replaceAll("UTF-8", "ISO-8859-1");
        }

        try {
            TransformerFactory tFactory = TransformerFactory.newInstance();
            Transformer transformer = tFactory.newTransformer(new javax.xml.transform.stream.StreamSource(
                    new ByteArrayInputStream(xsl.getBytes())));
            StreamSource source = new StreamSource(new ByteArrayInputStream(xml.getBytes()));
            ByteArrayOutputStream doc = new ByteArrayOutputStream();
            OutputStreamWriter osw = new OutputStreamWriter(doc, "ISO-8859-1");
            StreamResult result = new StreamResult(osw);
            transformer.setOutputProperty(OutputKeys.ENCODING, "ISO-8859-1");
            transformer.transform(source, result);

            out = doc.toString();

            int intIndex = out.indexOf("?>");
            if (intIndex > 0) {
                out = out.substring(intIndex + 2);
            }
            result = null;
            osw = null;
            doc = null;
            source = null;
            transformer = null;
            tFactory = null;
        } catch (TransformerConfigurationException e) {
            String msg = "No se puedo mesclar XML con XSL TransformerBSConfigurationException " + e.getMessage();
            throw new BSProgrammerException(msg, false);
        } catch (UnsupportedEncodingException e) {
            String msg = "No se puedo mesclar XML con XSL TransformerBSConfigurationException " + e.getMessage();
            throw new BSProgrammerException(msg, false);
        } catch (TransformerException e) {
            String msg = "No se puedo mesclar XML con XSL TransformerBSConfigurationException " + e.getMessage();
            throw new BSProgrammerException(msg, false);
        } catch (TransformerFactoryConfigurationError e) {
            String msg = "No se puedo mesclar XML con XSL TransformerBSConfigurationException " + e.getMessage();
            throw new BSProgrammerException(msg, false);
        }

        return out;

    }

    private static String readFile(String fileName) throws Exception {
        StringBuffer content = new StringBuffer(2048);
        boolean useEnter = true;
        java.io.FileInputStream fis = null;
        java.io.DataInputStream fid = null;
        String linea = null;
        fis = new java.io.FileInputStream(fileName);
        fid = new java.io.DataInputStream(fis);

        if (useEnter) {
            do {
                linea = fid.readLine();
                if (linea != null) {
                    content.append(linea);
                    content.append("\n");
                }
            } while (linea != null);
        } else {
            do {
                linea = fid.readLine();
                if (linea != null) {
                    content.append(linea);
                }
            } while (linea != null);
        }

        fid.close();
        return content.toString();
    }
